    message.includes('YouTube') ||
    message.includes('URL') ||
    message.includes('') ||
    message.includes('channel')
  ) {
    return 'validation';
  }
  
  // 
  if (
    message.includes('network') || 
    message.includes('timeout') || 
    message.includes('') ||
    message.includes('connect')
  ) {
    return 'network';
  }
  
  // 
  return 'general';
}

